import React, { useEffect, useState } from "react";
import axios from "./axios";

const Row=(props)=>{

    const [movies,setMovies]=useState([]);

    useEffect(()=>{
        async function fetchData(){
            const request=await axios.get(props.fetchUrl);
            setMovies(request.data.results);
            return request;
        }
        fetchData();
    },[props.fetchUrl]);

return (
<>
<h1>{props.title}</h1>

</>
);
}
export default Row;
